import React, { useState,useEffect } from 'react';
import { Link } from 'react-router-dom';
import { Image } from 'react-bootstrap'
import './Header.css';
import Aos from 'aos';
import 'aos/dist/aos.css';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
    root: {
        color: 'white',
        background: '#252525',
    },
  });

const Header = () => {
    useEffect(() => {
        Aos.init({ duration: 3000 });
    }, []);

    const [click, setClick] = useState(false);

    const handleClick = () => setClick(!click);
    const closeMobileMenu = () => setClick(false);

    const classes = useStyles();
    return (

        <>

            <nav className={classes.root} >
                <div className="navbar-container">
                    <ul>
                        <Link to="/"  onClick={closeMobileMenu}>
                            <Image className='just-navbar-logo' src='images/Original-transparent.png'></Image>
                        </Link>
                    </ul>
                    <div className='menu-icon' onClick={handleClick}>
                        <i className={click ? 'fas fa-window-close' : 'fas fa-bars'} />
                    </div>
                    <ul className={click ? 'nav-menu active' : 'nav-menu'}>
                        <li className='nav-item'>
                          <Link to="/" className="nav-links" onClick={closeMobileMenu}>
                                Home
                            </Link>  
                        </li>
                        <li className='nav-item'>
                            <Link to="/contact" className="nav-links" onClick={closeMobileMenu}>
                                Contact
                            </Link>
                        </li>
                        {/* <li className='nav-item'>
                            <Link to="/projects" className="nav-links" onClick={closeMobileMenu}>
                                Projects
                            </Link>
                        </li> */}
                        <li className='nav-item'>
                            <Link to="/process" className="nav-links" onClick={closeMobileMenu}>
                                Process
                            </Link>
                        </li>

                        <li className='nav-item'>
                            <a href="https://github.com/hpmacdonald" className="nav-links-mobile" onClick={closeMobileMenu}>
                            <small>GitHub</small><i className="fab fa-github"></i>
                            </a>
                        </li>
                    </ul>

                </div>
            </nav>


        </>
    )
}

export default Header;
